import React from 'react';
import logo from './logo.svg';
import './App.css';

function Hero() {
  return (
    <div className="App">
      <header className="App-header">
        <div id="nameAnimation">
          <h1 id="firstname">
            Alex <span id="lastname">Graham</span>
          </h1>
        </div>
        <p>
          IT Contractor and Website Builder
        </p>
      </header>
    </div>
  );
}

export default Hero;
